function App() {
  return (
    <div>
      <p className="h3 m-4">ჩანაცვლების პროცედურა</p>

  <nav className="navbar navbar-light bg-light" style={{width:'100%'}}>
  <form className="form-inline d-flex flex-row m-4">
    <input className="form-control mr-sm-2 mx-2" type="search" placeholder="შეიყვანეთ საწარმოს კოდი" aria-label="Search"/>
    <button className="btn btn-outline-success my-2 my-sm-0" type="submit">ძებნა</button>
  </form>
</nav>
    </div>
  );
}

export default App;
